import Label from "../../../components/Label";
const Specie: React.FC = ({ text }) => {
  const { t } = useTranslation();
  return (
    <>
      <Spacer size="sm" />
      <Spacer size="sm" />
      <Card className="wing-blank-lg">
        <Spacer />
        <div className="flex-jc-center color-grey wing-blank-lg">
          <div>抵押资产数量</div>
